// Helper functions
function xorEncrypt(text, key) {
    let result = '';
    for (let i = 0; i < text.length; i++) {
        result += String.fromCharCode(text.charCodeAt(i) ^ key.charCodeAt(i % key.length));
    }
    return result;
}

function enhancedBase64Decode(encoded) {
    const salt = "TN_GHOST_2025_SECURE";
    const decoded = decodeURIComponent(escape(atob(encoded)));
    return decoded.substring(salt.length, decoded.length - salt.length);
}

function enhancedUnreverse(text) {
    let result = '';
    for (let i = 0; i < text.length; i++) {
        result += String.fromCharCode(text.charCodeAt(i) - 1);
    }
    return result.split('').reverse().join('');
}
